  },
  {
    id: "e5",
    title: "Event 5",
    image: "https://picsum.photos/seed/abcde/200/300",
    date: "10-02-2024",
  },
];

const EventsPage = () => {
  return (
    <div>
      <h1>Events Page</h1>
      <EventsList events={DUMMY_EVENTS} />
    </div>
  );
};

export default EventsPage;
